import React from "react";
import "../stylesheets/ClubList.scss";
import Club from "./Club";

const ClubList = () => {
  return (
    <ul className="list">
      <Club
        icon={props.eachClub.fa}
        name={props.eachClub.name}
        members={props.eachClub.members.join(" , ")}
      />
    </ul>
  );
};

export default ClubList;
